    dfp_read_field_def_simple_request(Bin, 0, 0,
				      id('COMPRESSABLE', TrUserData),
				      id(0, TrUserData),
				      id('$undef', TrUserData),
				      id(false, TrUserData),
				      id(false, TrUserData),
				      id('$undef', TrUserData),
				      id('$undef', TrUserData),
				      id('$undef', TrUserData), TrUserData).

