						     F@_6, F@_7, F@_8,
						     TrUserData);
	    3 ->
		skip_group_simple_request(Rest, Key bsr 3, 0, F@_1,
					  F@_2, F@_3, F@_4, F@_5, F@_6, F@_7,
					  F@_8, TrUserData);
	    5 ->
		skip_32_simple_request(Rest, 0, 0, F@_1, F@_2, F@_3,
				       F@_4, F@_5, F@_6, F@_7, F@_8, TrUserData)
