				   Rest/binary>>,
				 N, Acc, _, F@_2, F@_3, TrUserData) ->
    {NewFValue, RestF} = {begin
			    <<Res:32/signed-native>> = <<(X bsl N +
							    Acc):32/unsigned-native>>,
			    id(Res, TrUserData)
			  end,
			  Rest},
    dfp_read_field_def_response_parameters(RestF, 0, 0,
					   NewFValue, F@_2, F@_3, TrUserData).

