    {NewFValue, RestF} = begin
			   Len = X bsl N + Acc,
			   <<Bs:Len/binary, Rest2/binary>> = Rest,
			   {id(decode_msg_bool_value(Bs, TrUserData),
			       TrUserData),
			    Rest2}
			 end,
    dfp_read_field_def_response_parameters(RestF, 0, 0,
					   F@_1, F@_2,
					   if Prev == '$undef' -> NewFValue;
					      true ->
