-compile({nowarn_unused_function,v_msg_reconnect_info/3}).
-dialyzer({nowarn_function,v_msg_reconnect_info/3}).
v_msg_reconnect_info(#{} = M, Path, TrUserData) ->
    case M of
      #{passed := F1} ->
	  v_type_bool(F1, [passed | Path], TrUserData);
      _ -> ok
    end,
    case M of
      #{backoff_ms := F2} ->
